import Expenseitem from "./Expenseitem";

const ExpenseTask = (prop) => {
  return ( 
    <div>
      <Expenseitem thatDay={Expdetails[0].thatDay} title={Expdetails[0].title} rate={Expdetails[0].rate} />
      <Expenseitem thatDay={Expdetails[1].thatDay} title={Expdetails[1].title} rate={Expdetails[1].rate}/>
      <Expenseitem thatDay={Expdetails[2].thatDay} title={Expdetails[2].title} rate={Expdetails[2].rate}/>
      <Expenseitem thatDay={Expdetails[3].thatDay} title={Expdetails[3].title} rate={Expdetails[3].rate}/>
      <Expenseitem thatDay={Expdetails[4].thatDay} title={Expdetails[4].title} rate={Expdetails[4].rate}/>
    </div>
   );
}
 
export default ExpenseTask;
